import { CloseOutlined } from '@ant-design/icons';
import React, { useState, useEffect } from "react";
import Card from "../../components/Card";
import { Typography, Button, Col, Row,  } from "antd";
import axios from "axios";
import FormGroup from "../../components/FormGroup";
import SelectMenu from "../../components/SelectMenu";
import SelectProfessions from '../../components/SelectProfessions'
import SelectEntitys from '../../components/SelectEntitys';
import HealthPlansTable from  './HealthPlansTable';
import { STATES } from '../../data/index';
import { Formik } from 'formik';
import ResetButton from '../../components/ResetButton'
import SubmitButton from '../../components/SubmitButton'
import SelectByForm from '../../components/SelectByForm'
import Form from '../../components/Form'
import Select from '../../components/Select'
import Input from '../../components/Input'

const baseApi = "http://lb-aws-1105894158.sa-east-1.elb.amazonaws.com";
const apiKey = "api-key=ddd70c32-fc98-4618-b494-a9698f824353";

const apiKeyFindEntity = "api-key=4b94dba2-5524-4632-939b-92df1c50a645"

const apiKeyFindHealthPlans = "api-key=261fd4d0-fd9f-468a-afa9-f5a89ed3701c"

const Text = Typography;

const HealthPlans = () => {
  const [professionList, setProfessionList] = useState();
  const [entityList, setEntityList] = useState();
  const [uf, setUf] = useState([]);
  const [cidade, setCidade] = useState('');
  const [profissao, setProfissao] = useState([]);
  const [datanascimento, setDatanascimento] = useState([]);
  const [entidade, setEntidade] = useState([]);
  const [disabledButtton, setDisabledButtton] = useState(true);
  const [disabledButttonEntity, setDisabledButttonEntity] = useState(true);
  const [healthPlansList, setHealthPlansList] = useState();

  const getProfessionalList = (cidade) => {
    console.log(cidade)
    if(cidade !== undefined) {

      axios
        .get(`${baseApi}/profissao/${uf}/${cidade}?${apiKey}`)
        .then((response) => {
          setProfessionList(response.data);
          setDisabledButtton(false)
        })
        .catch((erro) => {
          console.log(erro.response);
      });
    }
  }

  const getEntityList = (profissao) => {
    // setProfissao(profissao);
    axios
      .get(`${baseApi}/entidade/${profissao}/${uf}/${cidade}?${apiKeyFindEntity}`)
      .then((response) => {
        setEntityList(response.data);
        setDisabledButttonEntity(false)
      })
      .catch((erro) => {
        console.log(erro.response);
    });
  }


  const fetchHealthPlans = () => {
    axios
      .post(`${baseApi}/plano?${apiKeyFindHealthPlans}`, {
        entidade,
        uf,
        cidade,
        datanascimento: [datanascimento],
      })
      .then((response) => {
        setHealthPlansList(response?.data?.planos)
      })
      .catch((erro) => {
        console.log(erro.response);
    });
  };

    useEffect(() => {
      if(uf !== null && cidade !== '') {
        getProfessionalList();
      }
      // eslint-disable-next-line react-hooks/exhaustive-deps
    }, [uf, cidade ]) 

    useEffect(() => {
      console.log(cidade)
      if(uf !== null && cidade !== '' && profissao !== null) {
        getEntityList();
      }
      // eslint-disable-next-line react-hooks/exhaustive-deps
    }, [profissao]) 

    return (
      <>
        <Card title="Pesquisa por planos disponíveis">
          <br />
          <div className="row">
            <div className="col-md-6">
              <div className="bs-component">
                <FormGroup label="Estado">
                  <SelectMenu
                    defaultValue={uf}
                    className="form-control"
                    lista={STATES}
                    onChange={(e) =>
                      setUf(e.target.value)
                    }
                  />
                </FormGroup>
                <FormGroup label="Profissão">
                  <SelectProfessions
                    defaultValue={profissao}
                    className="form-control"
                    lista={professionList}
                    onChange={(e) =>
                      setProfissao(e.target.value)
                    }
                    disabled={disabledButtton}
                  />
                </FormGroup>
              </div>
            </div>
            <div className="col-md-6">
              <div className="bs-component">
                <FormGroup htmlFor="cidade" label="Cidade*">
                  <input
                    defaultValue={cidade}
                    type="text"
                    className="form-control"
                    id="inputNome"
                    placeholder="Digite a cidade"
                    onBlur={(e) =>
                      setCidade(e.target.value)
                    }
                  ></input>
                </FormGroup>
                <FormGroup htmlFor="datanascimento" label="Data de nascimento*">
                  <input
                    defaultValue={datanascimento}
                    type="date"
                    className="form-control"
                    id="inputNome"
                    aria-describedby="emailHelp"
                    placeholder="Digite a longitude"
                    onChange={(e) =>
                      setDatanascimento(e.target.value)
                    }
                  ></input>
                </FormGroup>
              </div>
            </div>
            <div className="col-md-6">
              <div className="bs-component">
                <FormGroup label="Entidade">
                  <SelectEntitys
                    defaultValue={entidade}
                    className="form-control"
                    lista={entityList}
                    onChange={(e) =>
                      setEntidade(e.target.value)
                    }
                    disabled={disabledButttonEntity}
                  />
                  </FormGroup>
              </div>
              <div className="col-12">
                <button className="btn btn-primary" 
                type="submit" 
                onClick={() => fetchHealthPlans()}
                >Buscar resultados</button>
              </div>
            </div>
          </div>
        </Card>
        <>
          <Card>
            <Text style={{fontSize: '24px'}}> Lista de planos disponíveis</Text>
          </Card>
          <HealthPlansTable healthPlansList={healthPlansList}></HealthPlansTable>
        </>
        <Row gutter={[20, 20]}>
        <Formik
          initialValues={{ deleteReason: '' }}
          // validationSchema={DELETE_REASON_VALIDATION}
          validateOnMount
          onSubmit={(values, { setSubmitting, resetForm }) => {
            console.log(values)
            // if (onSubmit) onSubmit(values, publication._id);
            // if (onClose) onClose();
            setSubmitting(false);
            resetForm();
          }}
        >
          <Form layout="vertical" style={{ width: '100%' }}>
            <Row gutter={[20,20]}>
              <Col md={12}>
                <Form.Item name="state" label="Estado">
                  <Select
                    name="genre"
                    placeholder="Selecione o estado"
                    style={{ width: '100%' }}
                    onSelect={(value) => setUf(value)}
                  >
                    {STATES.map((state, key) => (
                      <Select.Option key={key} value={state.value}>
                        {state.label}
                      </Select.Option>
                    ))}
                  </Select>
                </Form.Item>
              </Col>
              <Col md={12}>
                <Form.Item name="city" label="Cidade">
                  <Input.Search
                    name="email"
                    enterButton
                    placeholder="Digite o e-mail do patrocinador"
                    onSearch={value => { 
                      getProfessionalList()
                      setCidade(value)}}
                    type="email"
                  />
                </Form.Item>
              </Col>
            </Row>
            <Row gutter={[20,20]}>
              <Col md={12}>
                <Form.Item name="profissao" label="Estado">
                  <Select
                    name="profissao"
                    placeholder="Selecione o estado"
                    style={{ width: '100%' }}
                    onSelect={(value) => setProfissao(value)}
                  >
                    {professionList?.map((professional, key) => (
                      <Select.Option key={key} value={professional.profissao}>
                        {professional.profissao}
                      </Select.Option>
                    ))}
                  </Select>
                </Form.Item>
              </Col>
